import { useState } from "react";
import ExpencesIteam from "./ExpencesIteam";
const ListExpences = (props) => {
  return (
    <div>
      <ul>
        {props.items.map((exp) => (
          <ExpencesIteam
            title={exp.title}
            keys={exp.id}
            date={exp.date.toISOString()}
            amount={exp.amount}
          ></ExpencesIteam>
        ))}
      </ul>
    </div>
  );
};
export default ListExpences;
